import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Welcome.css';

const Welcome = () => {
  const navigate = useNavigate();

  const goToPosts = () => {
    navigate('/posts');
  };

  return (
    <div className="welcome-page">
      <div className="overlay">
        <h1>Welcome to My College Portal</h1>
        <button className="cta-button" onClick={goToPosts}>
          Want to know events happening?
        </button>
      </div>
    </div>
  );
};

export default Welcome;
